    data: |
      SELECT DISTINCT CAST ( col0 AS INTEGER ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( - 2 * - - ( - col1 ) * - 27 ) AND NOT + col0 + CAST ( 43 + ( - col2 ) AS INTEGER ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q7896.out
    data: |
